import requestsfrom bs4 import BeautifulSoupurl = "https://old.windguru.cz/fr/index.php?sc=48617"response = requests.get(url)soup = BeautifulSoup(response.text, 'html.parser') divClass = soup.find(id="div_wgfcst2")items = soup.findAll('var')text = ""for each in divClass:    text += each.textindexWINDSPD = text.find("WINDSPD")rawWINDSPD = text[indexWINDSPD+10 : indexWINDSPD+600]indexFin = rawWINDSPD.find("]")rawWINDSPD = rawWINDSPD[ : indexFin]print(rawWINDSPD)